import React from "react";
import "./styles.scss";
import StyledButton from "../StyledButton/StyledButton";

const ButtonGroup = ({ id, names, onClick }) => {
  return (
    <div className="buttongroup" id={id}>
      {names &&
        names.map((name) => (
          <StyledButton
            variant="container"
            size="small"
            className="buttongroup-item"
            onCick={onclick}
          >
            {name}
          </StyledButton>
        ))}
    </div>
  );
};

export default ButtonGroup;
